import React from 'react';

const TodoPanel = () => {
  return (
    <div>
      <div>
        <label htmlFor='name'>
          <div>name</div>
          <input type='text' />
        </label>
      </div>
      <div>
        <label htmlFor='desc'>
          <div>name</div>
          <input type='text' />
        </label>
      </div>
      <div>
        <button>ADD</button>
      </div>
    </div>
  );
};

export default TodoPanel;
